import React from 'react';
import MyContext from './MyContext';

class Pai extends React.Component {
  render() {
    return (
      <MyContext.Consumer>
        {
          (monet, spend) => (
            <div>
              <span>
                O filho
              </span>
            </div>
          )
        }
      </MyContext.Consumer>
    );
  }
}

export default Pai;
